import React from 'react';
import { Outlet } from 'react-router-dom';
import Header from '../Header';
const MainLayout = () => {
	return (
		<div className="wrapper">
			<Header   />
			<div className="content">
        <Outlet/>
        </div>
		</div>
	);
};

export default MainLayout;
